import { jsPDF } from "jspdf";

const convertTurkishChars = (name: string): string => {
    const turkishChars: { [key: string]: string } = {
        'ğ': 'g', 'Ğ': 'G', 'ı': 'i', 'İ': 'I',
        'ş': 's', 'Ş': 'S', 'ü': 'u', 'Ü': 'U',
        'ö': 'o', 'Ö': 'O', 'ç': 'c', 'Ç': 'C'
    };
    
    return name.split('').map(char => turkishChars[char] || char).join('');
}

interface Student {
    id: number,
    name: string,
    Department: {
        id: number,
        name: string
    }
}
export const generateBeratPdf = async (students: Student[]) => {
    const doc = new jsPDF({
        orientation: "landscape",
        unit: "in",
        format: [10, 7],
    });

    var imageData = "data:image/png;base64,";
    
    students.forEach((student, index) => {
        if (index > 0) {
            doc.addPage([10, 7]); // Add new page for each diploma after the first one
        }

        doc.setFont('Times New Roman');
        doc.setFontSize(52);
        
        const convertedName = convertTurkishChars(student.name);

        // Calculate text position for centering
        var textWidth = doc.getTextDimensions(convertedName).w;
        var centerX = doc.internal.pageSize.getWidth() / 2;
        var centerY = doc.internal.pageSize.getHeight() / 3;
        var textX = centerX - (textWidth / 2);
        var textY = centerY;
        
        // Add background image and text for each page
        doc.addImage(imageData, "JPEG", 0, 0, 10, 7);
        doc.text(convertedName, textX, textY + 0.7);


        doc.setFontSize(24);
        const convertetDepartment = convertTurkishChars(student.Department.name);
        var textWidth_dept = doc.getTextDimensions(convertetDepartment).w;
        var centerX_dept = doc.internal.pageSize.getWidth() / 2;
        var centerY_dept = doc.internal.pageSize.getHeight() / 3;
        var textX_dept = centerX_dept - (textWidth_dept / 2);
        var textY_dept = centerY_dept;

        doc.text(convertetDepartment, textX_dept, textY_dept - 0.9);
    });
    
    // Save the PDF with a generic name since it contains multiple diplomas
    doc.save(`high-honour-certificates.pdf`);

    return;
}